import React from 'react';
// import {Formik} from 'formik';
// import * as Yup from 'yup';

import {Navbar,Nav,Form,FormControl,Button,Container} from 'react-bootstrap'

import logo from '../logo-white.png';

const Feed = () => {
    return (
        <div>
            <Container fluid>
            <Navbar bg="primary" variant="dark">
                <Container>
                <Navbar.Brand href="#home" className="p-0">
                    <img
                        src={logo}
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                        alt="React Bootstrap logo"
                    />
                </Navbar.Brand>

                <Form inline style={{border:"1px solid #000"}}>
                <FormControl type="text" placeholder="Search" className="noborder" style={{borderRadius:"0px",width:"200px"}} />
                <Button variant="" className="search-button noborder"><span className="glyphicon glyphicon-search"></span></Button>
                </Form>
                <Nav className="float-right navlinks">
                <Nav.Link href="#home"><Button variant="outline-light">Home</Button></Nav.Link>
                <Nav.Link href="#features"><Button variant="outline-light">Find Friends</Button></Nav.Link>
                <Nav.Link href="#pricing"><Button variant="outline-light">Create</Button></Nav.Link>
                <Nav.Link href="#pricing"><Button variant="outline-light">Logout</Button></Nav.Link>
                </Nav>
                </Container>
            </Navbar>
            </Container>
        </div>
    )
}

export default Feed;
